import React, { Component } from "react";
import { Route, Link, Switch } from "react-router-dom";
import "./styles/style.css";

export default class App extends Component {
  render() {
    return (
      <Switch>
        <Route path="/" exact>
          <div className="hello">Is THis Mark Pro?</div>;
        </Route>
        <Route path="/jokes">
          <div className="hello">Is THis Mark Huang?</div>;
        </Route>
      </Switch>
    );
  }
}

const Svg = () => {
  return <div></div>;
};
